subSubSection.paragraph:
Description.
Protoconch multispiral (about 2.0 whorls), planispiral, smooth (
Fig. 70A
), transition to teleoconch I marked by well-defined apertural varix (
Fig. 70A
). Teleoconch I short, sculptured with axial threads, crossed by weak irregular longitudinal sculpture (
Fig. 70B
), transition to teleoconch II marked by change in sculpture (
Fig. 70A
). Teleoconch II about same length as teleoconch I, sculptured with stronger irregular longitudinal sculpture (
Fig. 70C
), transition to teleoconch III marked by change in sculpture (
Fig. 70D
). Teleoconch III sculptured with numerous, short, close-set, longitudinal striae, beneath sporadic, longitudinal, sinuous, raised cords (
Fig. 70E
), may develop low annuli (
Figs. 70D
, J–K), transition to teleoconch IV marked by change in sculpture (
Figs. 70D
, J–K). Teleoconch IV may have narrow annuli, otherwise sculptured with similar characters as in previous stage, increasing in strength and density (
Fig. 70F
, J–K), transition to teleoconch V marked by suture and increase in width (
Figs. 70D
, J–K). Teleoconch V (last growth stage) average size for genus [Tol 
2.07–2.72 mm
], tubular, thick, robust, moderately and regularly arched [Larc: 
0.58–0.89 mm
; Arc: 
0.18–0.25 mm
], subcylindrical with increase in diameter from posterior to aperture, creamy white (
Figs. 69
A–C). Axial sculpture of 23–50 raised, strong, thick, narrow to wide, quadrangular ribs, closely arranged and regularly spaced, except last 3–5 preceding aperture, which narrow slightly on ventral side (
Figs. 70G, L
). Axial interspaces rather deep, narrower than ribs (
Figs. 70G, L
). Surface sculptured with numerous, conspicuous, dense, longitudinal striae on axial ribs and interspaces (
Figs. 70H, M
). Striae strength alternates in intensity, with 2–4 faintly more impressed (
Figs. 70H, M
). Posterior [Dpe: 
0.44–0.52 mm
] with thick edge, squared shoulder (
Fig. 69H
). Septum mucronate, flattened to deeply recessed (
Figs. 69
A–C). Mucro with rounded point or finger-like, conical, blunt, positioned on dorsal margin, straight to slightly curved toward dorsal margin (
Figs. 69
D–E. H). Aperture [Da: 
0.59–0.79 mm
] with abrupt deep sulcus followed by varix (
Figs. 70G, L
), sculpture of sulcus and varix more uniform than posterior end (
Figs. 70I, N
). Varix well-defined, with large ring consisting of 3–5 axial ribs, last 1–2 sharply narrowed on ventral side (
Figs. 70G, L
). Lip smooth, weakly developed, with slightly deflected peristome (
Figs. 69D, E
). Periostracum not observed. Operculum thin, light brown; exterior surface with 7–8 concentric rings (
Figs. 69
F–G). Conceptual reconstruction of growth stages shown in 
Fig. 71A
.
